"use strict";

const ascii_uppercase = "ABCDEFGHIJKLMNOPQRSTUVWXYZ";

function f_gold(s) {
    let ss = new Set(s);
    for (let i = ascii_uppercase.length - 1; i >= 0; i--) {
        let c = ascii_uppercase[i];
        if (ss.has(c) && ss.has(c.toLowerCase())) {
            return c;
        }
    }
    return '';
}
